import React, {
  Component
} from 'react';
export default class Test extends Component {
	constructor() {
		super()
	}
	handleClick(e){
		console.log(e.target);
	}
	render() {
		return (
			<div onClick={(e)=>this.handleClick(e)}>shabi</div>
		);
	}
}
